{
  "advertisements": [
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "1. Ein extra feiner Baum von guter Qualitaet, halb, an Se. Hochfuerstl. Durchl. zu Basel."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "2. Ein schoenes Lusthaus nebst einem Garten, in der Vorstadt St. Alban."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "3. Eine Wiese, wohl gelegen, nahe bei der Stadt, an dem Herrn von Muellheim."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "4. Ein Haus in der Stadt, mit allem Zubehoer, an dem Eigenthuemer."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "5. Ein Pferd, mit Sattel und Zaum, in dem Stall zum Loewen."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "6. Ein Wagen, in gutem Zustand, an dem Kutscher in der Spalen-Vorstadt."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "7. Ein Paar Stiefel fuer einen Knaben, von gutem Leder, in dem Haus zum Rothen Kreuz."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "8. Fuenf Stuecke Tuch, von Englischer Fabrick, in dem Laden zum Stern."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "9. Ein silberner Becher, mit Eingravirung, aus dem Nachlass eines Herrn."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "10. Eine Kuh mit Kalb, in dem Hof zu Allschwil."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "11. Ein Band Buecher ueber Theologie, an dem Buchhaendler in der Freien Strasse."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "12. Ein Clavier, von guter Machart, in dem Haus zum Gruenen Baum."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "13. Drey Faesser Wein vom Jahr 1749, halb, an dem Kellermeister in der Rheingasse."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird zum Verkauf angezeiget",
      "text": "14. Ein goldener Ring mit Stein, in dem Juwelier zum Kronen."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Gefunden",
      "text": "Gefunden. Am 8. Junius ist auf der Strasse ein goldener Ring gefunden worden. Der Eigenthuemer kann sich melden in dem Bericht-Haus."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Verloren",
      "text": "Verloren. Ein schwarzer Hund mit weissen Flecken, verloren am 9. Junius auf dem Markt, Finder wird belohnt."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Zu vermiethen",
      "text": "Zu vermiethen. Ein Haus in der Petersgasse, mit vier Zimmern, ab dem 1. Julius."
    },
    {
      "date": "1752-06-11",
      "tags_section": "Es wird gesuchet",
      "text": "Es wird gesuchet. Ein tuichtiger Knecht fuer den Hof, melde sich in dem Haus zum Adler."
    }
  ]
}
